            return(
                <>
                Hello
                </>
            )
        })
    }

    return (
        <section class="contactPage">
			<div class="mainTitle">
				Contact
			</div>

			<hr class="whiteLine" />

			<div class="container containerThirdPage">
				<div class="row">
					<div class="col-lg-6">
						<a href="mailto: aman.shrestha@rochester.edu" target="_blank">
							<img src="Pictures/gmail.png" class="contactImage"/></a>
						<a href="mailto: aman.shrestha@rochester.edu" target="_blank">
							aman.shrestha@rochester.edu
						</a>
					</div>
				</div>
			</div>
		</section>
    )
}

export default Contact
